import {LitElement, html, css} from 'lit'


export class winBanner extends LitElement{

    static properties = {
        value: {type: String},
    }

    static styles = css
    `
        .win-banner{
            color: white;
            text-align: center;
            width: 50%;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            overflow: hidden;
            z-index: 99;
        }

        .win-banner img{
            width: 100%;
            height: auto;
        }

        p{
            position: absolute;
            top: 38%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 32px;
        }

        @media(max-width: 1400px){
            .win-banner{
                width: 80%;
            }
            p{
                top: 40%;
                font-size: 28px;
            }
        }

        @media(max-width: 1000px){
            .win-banner{
                width: 80%;
            }
            p{
                top: 38%;
            }
        }

        @media(max-width: 700px){
            .win-banner{
                width: 100%;
            }

            p{
                top: 36%;
            }
        }

        @media(max-width: 600px){
            p{
                top: 35%;
            }
        }

        @media(max-width: 500px){
            p{
                top: 35%;
                font-size: 22px;
            }
        }

        @media(max-width: 400px){
            p{
                top: 32%;
            }
        }
    `

    constructor(){
        super()
        this.value = ""
    }

    render(){
        // Base64 img for vercel
        return html
        `   
                <div class="win-banner">

                    <img alt="" src="data:image/png;base64," />
                    <p>You ${this.value}!</p>
                </div>
        `
    }
}

customElements.define('win-banner', winBanner)